Laiške Oskaras ironiškai dėstė mintis apie sąlygas, kuriomis turi dirbti: „O geriu aš išimtinai dėl vienos priežasties – man reikia versti aktorius vaidinti ne teatre, o ofise, nedaug didesniame negu jūsų sekretorės. Blaiviam to daryti man neleidžia sąžinė“. Laiške taip pat kalbama apie seksualiniu priekabiavimu kaltinamą režisierių Šarūną Bartą bei mero Remigijaus Šimašiaus sprendimus. O. Koršunovo laiškas  (kalba netaisyta) : Kelionė į rojų. IX dalis Atviras laiškas Vilniaus merui, gerbiamam R. Šimašiui Noriu padėkoti ir išreikšti pagarbą už jūsų neabejingumą merginų paviešintam seksualinio priekabiavimo atvejui. O taip pat už tai, jog ėmėtės prevencijos tokio pobūdžio veikai. Mes visi žinome kaip Lietuvoje veikia teismai, todėl jūsų nepasitikėjimas teismais ir jų funkcijomis, manau, yra pateisinamas. Juk mes gyvename laikais, kai Facebooko postas yra aukščiau už aukščiausio teismo verdiktą, ir tai yra teisinga, nes tik tai gali apvalyti mūsų visuomenę. Štai dabar Kinemos kolektyvas jau apleido jums priklausančias patalpas, ir manau, greitu laiku apleis Vilniaus miestą. Be jų Vilniaus kultūros moralinis veidas tikrai bus švaresnis, o ir jūsų toks moralinis šypsnys bent jau kuriam laikui apšvies tamsias naktinio Vilniaus gatves, kurios tokios patogios priekabiautojams. Taigi, gerbiamas mere, turiu visgi pranešti, kad būtent tose tamsiose gatvėse prie manęs ypač dažnai priekabiaujama. Vis tik, grįžusį iš rojaus ir praradusį budrumą, mane ir vėl užpuolė. Man, kaip ir daugeliui moterų, geriau gerti namie, nes jeigu aš išgeriu mieste, prie manęs pradeda priekabiauti šaligatvis. Todėl jūsų prašau sutvarkyti tą jums priklausantį šaligatvį arba pastatyti man teatrą. Tada aš nustosiu gerti, o prie manęs blaivo šaligatvis nedrįsta kabintis. O geriu aš išimtinai dėl vienos priežasties - man reikia versti aktorius vaidinti ne teatre, o ofise, nedaug didesniame negu jūsų sekretorės. Blaivam to daryti man neleidžia sąžinė. Juolab aš negaliu matyti žiūrovų, pirkusių brangius bilietus ir patekusių ne į teatrą, o į mažytę patalpėlę, primenančią jų darbovietes. Aš jau nekalbu apie pastovų oro trūkumą. Taigi, aš nuolat patiriu dvigubą traumą: viena susijusi su savivaldybės mums skirtomis patalpomis, kita - visuomet aidu atsikratojančia traumine labai skaudžia šaligatvio sindromo patirtimi. Žinoma, tai yra sunkiai įrodoma, todėl aš ir nesikreipiu į teismus, o prašau į tai pasižiūrėti remiantis grynai moraliniu aspektu. Ir, žinoma, tikėtinais šio posto FB palaikinimais. Jeigu postas nesurinks reikiamo laikų kiekio ir Vilniaus miesto teatras taip ir liks nenusipelnęs normalesnių patalpų, tai visgi noriu pasakyti, jog mes ir toliau dirbsime tokiomis sąlygomis. Ir toliau garsinsime Vilniaus miesto teatro vardą visame pasaulyje. Tik, žinoma, labai sunku slėpti mūsų tikrąją padetį prisistatant užsienyje, ypač kai reikia pateikti spektaklių nuotraukas - tenka meluoti, jog nuotraukos darytos kambarėlyje prie scenos, teatralų taip vadinamoje kišenėje. Vis dėlto, aš tikiuosi supratimo ir pagalbos. Širdingai dėkoju. P.S. Aš tikiuosi, jog skaitydamas mano postą iš rojaus apie Bartą jūs neįsižeidėte ir supratote, kad skaistykloje Bartą kankinantis operatorius iš tiesų esate ne jūs, o skaistyklos darbuotojas - budelis, užsidėjęs jūsų kaukę. Arba kitaip tariant, paties Barto sąžinės fantomas. Taip pat ir toji merga, dėl kurios visi ar visos įsižeidė, yra ne konkreti nukentėjusioji, o kaltininko sąžinės furija. Tas pats liečia ir feminisčių chorą. Man atrodo, kai kurie žmonės švento teisingumo priepuolyje be reikalo pradėjo mane deginti, o tiksliau - delete’inti. Bet aš juos suprantu - aš irgi dažnai apimtas stiprių jausmų atsitrenkiu į stiklines duris, kurių tiek daug ir visos automatinės, o automatika ne visada suveikia. Taigi, aiškumo dėlei pasikartosiu. Bartas mano poste Dievo valia yra prideramai nubaustas. Visos feministės, taip pat ir jūs, gerbiamas mere, neabejotinai pateksite į rojų. O merginos bus paskelbtos šventosiomis. Tik noriu pridurti, jog jūs,